  \"Blackwater National Wildlife Refuge Complex: Blackwater National Wildlife Refuge,
  Susquehanna National Wildlife Refuge, Martin National Wildlife Refuge: Annual narrative
  report: Calendar year 1994\",\n\t\"tracking_summary\": {\n\t\t\"total\": 0,\n\t\t\"recent\":
  0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-10-15T16:36:49.175601\",\n\t\"name\": \"blackwater-national-wildlife-refuge-complex-blackwater-national-wildlife-refuge-susquehann-63c3a\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Blackwater
  National Wildlife Refuge outlines Refuge accomplishments during the 1994 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  management planning, public participation, compliance with environmental mandates,
  and research and investigations. Refuge administration is outlined; information
  about personnel, youth programs, other manpower programs, volunteer programs, funding,
  safety, and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, forests, croplands, fire management, and pest control. The wildlife
  section of the report discusses endangered and threatened species, waterfowl, marsh
  and water birds, shorebirds, raptors, other migratory birds, game mammals, other
  resident wildlife,  surplus animal disposal, animal control, marking and banding,
  and disease prevention and control. The public uses of the Refuge described in this
  report include information and interpretation, outdoor classrooms, hunting, fishing,
  trapping, wildlife observation, law enforcement, and cooperating associations. The
  equipment and facilities section of the report provides information about rehabilitation,
  major maintenance, equipment utilization and replacement, communication systems,
  and computer systems. Items of interest are provided at the end. Photographs and
  brochures are attached. Brief narrative reports for Glen L. Martin and Susquehanna
  National Wildlife Refuges are included.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
